Information
------------------------------

A Passion for the Pre-Raphaelites
Famed for his hit musicals such as The Phantom of the Opera and Joseph the Amazing Technicolor Dreamcoat, composer Andrew Lloyd Webber is less well-known as a collector of art. But in this film he will reveal his passion for the Pre-Raphaelites as he shows us some of the best examples of this period from around the country, as well as selected works from his own collection.

